
CREATE TABLE IF NOT EXISTS billing_details (
    Advertising_ID VARCHAR(50) PRIMARY KEY,
    Billing_Account_Name VARCHAR(100),
    Billing_Account_Name_Organisation VARCHAR(200),
    Billing_Account_Number VARCHAR(200),
    Billing_Account_Number_Organisation VARCHAR(200),
    ACN VARCHAR(200)
);


CREATE TABLE IF NOT EXISTS payment_info (
    BACS_Service_User_Number VARCHAR(200) PRIMARY KEY,
    Bank_Account_Number VARCHAR(200),
    Bank_Account_Sort_Code VARCHAR(100),
    Payment_Card VARCHAR(200)
);
